class HotelAutoComplete(ListAPIView):
    serializer_class = HotelSerializer
    permission_classes = []

    def list(self, request):
        city_list = []
        hotel_list = []
        if request.GET.get('q', None):
            city_list = Hotel.objects.filter(
                city__name__icontains=request.GET.get('q')
            ).values('city__name', 'city__country__name')

            hotel_list = Hotel.objects.filter(
                name__icontains=request.GET.get('q')
            ).values('name', 'slug')
        return Response({'city_list': city_list, 'hotel_list': hotel_list}, status=200)
